import './contact.scss';
import vancouver from './img/vancouver.png'


export default function Contact() {


  return (
    <div className="main" style={{display: 'flex', flexDirection: 'column'}}>
        <div className="email">
          <img src={vancouver} />
          <div className="resume">
            <div>Work Experience</div>
            <div>
              Education
            </div>
          </div>

        </div>

      </div>
  )
}
